import React from "react";

// Functional Component
const HomePage = () => {
    return(
        <div>
            <p id="homepage-title">Car Haven</p>
            <video><source src = "https://f1rstmotors.com/wp-content/uploads/2022/12/website-video_resized.mp4" type="video/mp4"></source></video>
        </div>
    )
};

// Export
export default HomePage;
